import React from 'react'
import Sidebars from '../layout/dashboard/Sidebars'
import TimeToHire from './TimeToHire';

const TimeToHirePage = () => {
  return (
    <div>
      <Sidebars>
        <TimeToHire />
      </Sidebars>
    </div>
  )
}

export default TimeToHirePage
